import React, { Component } from "react";
import counter from "../Component/counter";

class Counters extends Component {
  state = {
    Counters: [
      { id: 1, value: 0 },
      { id: 2, value: 0 },
      { id: 3, value: 0 },
      { id: 4, value: 0 },
      { id: 5, value: 0 },
    ],
  };
  render() {
    <counter />;
  }
}

export default Counters;
